import prof from './img/employeeIcon.png'

export default function Profile(props) {
    return (
        <div className="container">
            <div className="row">
                <div className="col"> <img src={prof} /></div>
                <div className="col"><h1 className="headerUser py-5 my-5">Tito aaron</h1></div>
            </div>
        </div>
    )
}
